def calculate(code):
    return sys.getsizeof(code) / 1024


def change_line(count = 1):
    if   count ==  3: count    = -1
    elif count == -3: count    =  1
    if count < 0: margin_index =  1 # down
    else:         margin_index =  0 # up
    return ''.join([values.get("managings")[margin_index] for i in range(0, abs(count))])


